import React from "react";
import { Footer, Navbar } from "../components";

const ContactPage = () => {
  const handleSubmit = async (event) => {
    event.preventDefault();

    const form = event.target;
    const data = new FormData(form);

    // Add Web3Forms API key to the form data
    data.append("access_key", "596f3a95-67b8-4025-a174-3a1b35d42ab5");

    try {
      const response = await fetch("https://web3forms.com/api/submit", {
        method: "POST",
        body: data,
      });
      if (response.ok) {
        // Handle success (optional: show a success message or clear the form)
        alert("Message sent successfully!");
      } else {
        // Handle errors (optional: show an error message)
        alert("Failed to send the message. Please try again later.");
      }
    } catch (error) {
      console.error("Error submitting the form:", error);
    }
  };

  return (
    <>
      <Navbar />
      <div className="container my-3 py-3">
        <h1 className="text-center">Contact Us</h1>
        <hr />
        <div class="row my-4 h-100">
          <div className="col-md-4 col-lg-4 col-sm-8 mx-auto">
            <form onSubmit={handleSubmit}>
              <div class="form my-3">
                <label htmlFor="Name">Name</label>
                <input
                  type="text"
                  class="form-control"
                  id="Name"
                  name="name"
                  placeholder="Enter your name"
                />
              </div>
              <div class="form my-3">
                <label htmlFor="Email">Email</label>
                <input
                  type="email"
                  class="form-control"
                  id="Email"
                  name="email"
                  placeholder="name@example.com"
                />
              </div>
              <div class="form my-3">
                <label htmlFor="Message">Message</label>
                <textarea
                  rows={5}
                  class="form-control"
                  id="Message"
                  name="message"
                  placeholder="Enter your message"
                />
              </div>
              <div className="text-center">
                <button class="my-2 px-4 mx-auto btn btn-dark" type="submit">
                  Send
                </button>
              </div>
            </form>
          </div>
        </div>
      </div>
      <Footer />
    </>
  );
};

export default ContactPage;
